import React from 'react';

import classes from './Respaldo.module.css';

const Respaldo = () => {
    return ( 
        <div className={classes.Respaldo}>
            <h2>Pasos:</h2>
            <div className={classes.containerRespaldo}> 
            <span>Altura: 160</span>
                <div className={classes.respaldo}>
                
            </div>
            <span>Ancho: 120</span>
            </div>
            
            
        </div>
     );
}
 
export default Respaldo;
